import React from "react";
import {
  Navbar,
  Row,
  Col,
  Container,
  Nav,
  NavDropdown,
  Form,
  Button,
  FormControl,
} from "react-bootstrap";
import NavbarCollapse from "react-bootstrap/esm/NavbarCollapse";
import NavbarToggle from "react-bootstrap/esm/NavbarToggle";
import "./First.css";
import image from "./image-transform.jpg";
const First = () => {
  return (
    <div>
      <Container fluid >
        <div className="row" id="con">
            <div className='sec1  m-4  col-12 col-sm-ms-auto'>
              <h2 className="">Transform your <br/>brand</h2>
              <p className="my-5">
                We are a full-service creative agency specializing in helping
                brands grow fast. Engage your clients through compelling visuals
                that do most of the marketing for you.
            </p>
            <a href="#" className="learnmore">Learn more</a>
            </div>
            <div id='pic1' className='  col '>
              <img src={image}></img>
            </div>
        </div>
      </Container>
    </div>
  );
};

export default First;
